import "./Home.css";

function Home () {
  return (
<> 

   <Navbar/>

  <body style={{backgroundColor:'#dfe8ff'}}>

  {/*Paragrafo*/}
  <div  id="paragrafo" style={{padding:'30px 0 30px 0', backgroundColor: '#0a3dbf', color:'white'}}>

    <div className="container">

    <div className="row justify-content center">

    
